text:
@iamusjaan @DailySangar ڈرو اس دن سے جب بلوچ اپنی دفاعی سوچ سے ہٹ کر گھس گھس مارنے نکلے گا 

ابھی تو ہم انٹرنیشنل قوانین کے مطابق اپنی جنگ لڑ رہیں ہیں مگر لگتا ہے لاتوں کے بھوت عزت سے نہیں مانے گے ظلم و بربریت جس طرح بڑے گا بلوچ فریڈم فائٹرز بھی کہیں نہ کہیں جا کر مجبور ہونگے ایسا قدم اٹھانے سے

گل خان

@hamza_hazard7 @DailySangar Every now and then gutter mouths like you come to spout nonsense.

Tell me Baloch freedom fighters killed your father or mother?

Pandu punjabi Samraj
